import React, { Component } from 'react';
import Myuser from "../../data/myuser";
import User from "../user/user";
import GenericComponent from "../generic-component/generic-component"
import MyTextBox from "../my-textbox/my-textbox";
import MyButton from "../my-button/my-button";
import MyDiv1 from "../my-div/my-div";
import GitHub from "../git-hub/git-hub";
import Mymap from "../my-map/my-map";

class MyProps extends Component {
    render() {
        //props: buil-in collects data that parent is providing (by react) :: parent to child communication
        return <div>
            JS is {this.props.name}<br/>
            <h5>This is User Component: </h5><User user={Myuser} />
            <h5><GenericComponent /></h5>
            <h5><GenericComponent things="cadbury"/></h5>
            <MyTextBox />
            <MyButton />
            My Div: <MyDiv1  name=" the best"/>
            Git Hub: <GitHub source="https://api.github.com/users/octocat/gists" />
            My Map: <Mymap />
        </div>;
    }
}

export default MyProps ;
export const attrb1 = 15;
export const attrb2 = 21;

